E_D("replace into `phome_ecms_infotmp_game` values('2162','17','http://www.61baobao.com/tingerge/1554/','0','2012-06-29 02:20:16','虫师','2012-06-29 02:20:16','4usky','2','1340907616','','http://www.61baobao.com/common/flash/2007/pic/1554.jpg','','0','','http://s.61baobao.com/common/flash/2007/chongshi.swf','667','479','I walked ten thousand miles, ten thousands miles to reach you<br />And ever gasp to breath, I grabbed it just to find you<br />I climbed up every hill to get to you<br />I wandered ancient lands to hold just you<br /><br />And every single step of the way, I paid<br />Every single night and day I searched for you<br />Through sand storms and hazy dawns I reached for you<br /><br />I stole ten thousands pounds, ten thousand pounds to see you<br />I robbed convenience sotres coz I thought they/''d make it easier<br />I lived off rats and toads and I starved for you<br />I fought off giant bears and I killed them too<br /><br />And every single step of the way, I paid<br />Every single night and day I searched for you<br />Through sand storms and hazy dawns I reached for you<br />I/''m tired and I/''m weak but I/''m strong for you<br />I want to go home but my love gets me through','http://www.61baobao.com/common/flash/2007/dpic/1554.jpg','1554','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXpUREpPYjJJeU5XNWpNbWh3VEc1T00xcG5QVDA9','http://s.61baobao.com/common/flash/2007/chongshi.swf','http://www.61baobao.com/common/flash/2007/dpic/1554.jpg','http://www.61baobao.com/common/flash/2007/pic/1554.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('2163','17','http://www.61baobao.com/tingerge/1553/','0','2012-06-29 02:20:16','唱给妈妈的摇篮曲　','2012-06-29 02:20:16','4usky','2','1340907616','','http://www.61baobao.com/common/flash/2007/pic/1553.jpg','','0','','http://s.61baobao.com/common/flash/2007/cgmmylq.swf','667','479','月儿当头照，<br />夜深了，<br />妈妈屋里静悄悄。<br />亲爱的妈妈呀，<br />伏在桌上睡着了，<br />伏在桌上睡着了。<br />我把灯熄了，<br />心里想，<br />桌子变成摇篮摇。<br />我来摇妈妈，<br />一直摇到太阳照，<br />一直摇到太阳照。<br />轻轻走上前，<br />给妈妈，<br />披上我的小花袄。<br />亲爱的妈妈呀，<br />梦中正在微微笑，<br />梦中正在微微笑。<br />呜<br />呜<br />呜<br />呜','http://www.61baobao.com/common/flash/2007/dpic/1553.jpg','1553','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXpUREpPYm1KWE1UVmlTRVYxWXpOa2JRPT0=','http://s.61baobao.com/common/flash/2007/cgmmylq.swf','http://www.61baobao.com/common/flash/2007/dpic/1553.jpg','http://www.61baobao.com/common/flash/2007/pic/1553.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('2164','17','http://www.61baobao.com/tingerge/1552/','0','2012-06-29 02:20:16','长江我的家','2012-06-29 02:20:16','4usky','2','1340907616','','http://www.61baobao.com/common/flash/2007/pic/1552.jpg','','0','','http://s.61baobao.com/common/flash/2007/changjiang.swf','667','479','小河它有家，小鸟它有家，我也有个我爱的家；小草有妈妈，小树有妈妈，我也有个爱我的妈妈。 <br />长江长江是我的家，长江是我的妈妈，心里装着妈妈的爱，走遍天涯想着家。 <br />小河流走啦，小鸟飞走啦，他们是不是想回家；小草长高啦，小树长高啦，他们忘不了的是妈妈。 <br />长江长江是我的家，长江是我的妈妈，心里装着妈妈的爱，走遍天涯想着家。我也想回家，我要去看妈妈，心里装着妈妈的爱，走遍天涯想着家。','http://www.61baobao.com/common/flash/2007/dpic/1552.jpg','1552','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXpUREpPYjFsWE5XNWhiV3hvWW0xamRXTXpaRzA9','http://s.61baobao.com/common/flash/2007/changjiang.swf','http://www.61baobao.com/common/flash/2007/dpic/1552.jpg','http://www.61baobao.com/common/flash/2007/pic/1552.jpg','三个月以上','0','0','','0');");
