E_D("replace into `phome_ecms_infotmp_game` values('2173','17','http://www.61baobao.com/tingerge/1542/','0','2012-06-29 02:20:35','波斯猫','2012-06-29 02:20:35','4usky','2','1340907635','','http://www.61baobao.com/common/flash/2007/pic/1542.jpg','','0','','http://s.61baobao.com/common/flash/2007/boshimao.swf','667','479','眼眯成一条线轻轻踮着脚尖<br />屋顶上的瓦片是他的琴键<br />一步步一点点游走在爱情边缘<br /><br />想出现就出现想不见就不见<br />想睡就睡一天不理任何人<br />不回电不上线不会和任何人争辩<br /><br />爱上他危险危险不爱他思念思念<br />他总是若即若离若隐若现<br />有时候沈默冰冷有时候温柔腼腆<br />任谁都不会是他爱情的主人<br /><br />靠近时缠绵缠绵离开时敷衍敷衍<br />他总是忽热忽冷忽近忽远<br />他可以一成不变也可以瞬息万变<br />但是他不会为你做任何改变<br /><br />波斯猫眯着他的双眼波斯猫踮着他的脚尖<br />波斯猫守着他的爱恋一转眼却又看不见<br /><br />什么他都看见什么都没看见<br />无谓的耸耸肩是他的消遣<br />左一遍右一遍等待着他的有情人','http://www.61baobao.com/common/flash/2007/dpic/1542.jpg','1542','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXpUREpLZG1NeWFIQmlWMFoyVEc1T00xcG5QVDA9','http://s.61baobao.com/common/flash/2007/boshimao.swf','http://www.61baobao.com/common/flash/2007/dpic/1542.jpg','http://www.61baobao.com/common/flash/2007/pic/1542.jpg','三个月以上','0','0','','0');");
