E_D("replace into `phome_ecms_infotmp_game` values('2191','17','http://www.61baobao.com/tingerge/1523/','0','2012-06-29 02:20:59','斑鸠调','2012-06-29 02:20:59','4usky','2','1340907659','','http://www.61baobao.com/common/flash/2007/pic/1523.jpg','','0','','http://s.61baobao.com/common/flash/2007/banjiu.swf','667','479','天马格叫(呀哈咳)?春天斑鸠叫(呀哈咳)，斑鸠(里格)叫(咧)起，实在(里格)叫得好(哇―呀―子哟)。你在那边叫(哟哈咳)，我在这边听(呀哈咳)，斑鸠(里格)叫(咧)起，叽里古噜古噜叽里叫得(那个)桃花开(哟哈咳)，叫得(那个)桃花笑(哟哈咳)，桃子(那个)花儿开，实在(里格)真漂亮(哇―呀―子哟)。 <br />','http://www.61baobao.com/common/flash/2007/dpic/1523.jpg','1523','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXpUREpLYUdKdGNIQmtVelY2WkRKWlBRPT0=','http://s.61baobao.com/common/flash/2007/banjiu.swf','http://www.61baobao.com/common/flash/2007/dpic/1523.jpg','http://www.61baobao.com/common/flash/2007/pic/1523.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('2192','17','http://www.61baobao.com/tingerge/1522/','0','2012-06-29 02:20:59','白杨树','2012-06-29 02:20:59','4usky','2','1340907659','','http://www.61baobao.com/common/flash/2007/pic/1522.jpg','','0','','http://s.61baobao.com/common/flash/2007/baiyangshu.swf','667','479','该向左 还是该向右 <br />都接受 跟你节奏 <br />向前走 彷佛没尽头 <br />让谁带你天际遨游 <br />旋转木马 <br />给多少人梦 送多少快乐 <br />起起落落 你快不快乐 <br />你得到了什么 <br />太快乐 也会没感觉 <br />太痛苦 也会麻痹 <br />倒不如 直接又了当 <br />不用制造任何理由 <br />旋转木马 <br />在找寻什么 为迎送欢乐 <br />木偶背后 当喧哗人散 <br />留下更多寂寞 <br />当你知道了黎明再不会来 <br />会不会又继续等还是功成身退 <br />看着你天真如小孩情愿不打烊','http://www.61baobao.com/common/flash/2007/dpic/1522.jpg','1522','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXpUREpLYUdGWWJHaGliV1I2WVVoVmRXTXpaRzA9','http://s.61baobao.com/common/flash/2007/baiyangshu.swf','http://www.61baobao.com/common/flash/2007/dpic/1522.jpg','http://www.61baobao.com/common/flash/2007/pic/1522.jpg','三个月以上','0','0','','0');");
