E_D("replace into `phome_ecms_infotmp_game` values('2248','17','http://www.61baobao.com/tingerge/354/','0','2012-06-29 02:22:24','三个和尚','2012-06-29 02:22:24','4usky','2','1340907744','','http://www.61baobao.com/common/flash/2006/pic/354.jpg','','0','','http://s.61baobao.com/common/flash/2006/sange.swf','667','479','一个和尚挑呀么挑水喝<br />嘿嘿 挑呀么挑水喝<br />咿咿 挑呀么挑水喝<br />两个和尚抬呀么抬水喝<br />嘿嘿 抬呀么抬水喝<br />咿咿 抬呀么抬水喝<br />三人和尚没水喝没呀没水喝<br />嘿 没呀没水喝呀<br />咿 没呀没水喝呀<br />你说这是为什么呀为呀为什么<br />嘿嘿 你说这是为什么呀为呀为什么<br />为什么呀和尚越来越多<br />嘿嘿 越来越多<br />咿咿 越来越多<br />为什么呀和尚越来越懒惰<br />嘿嘿 越来越懒惰<br />咿咿 越来越懒惰<br />为什么呀长老呀不来说一说呀<br />嘿 不来说一说呀<br />咿 不来说一说呀<br />睁着眼闭着眼阿弥陀佛<br />嘿嘿 睁着眼闭着眼阿弥陀佛<br />大和尚说挑水我挑的最多<br />嘿嘿 挑的最多<br />咿咿 挑的最多<br />二和尚说新来的应该多干活<br />嘿嘿 应该多干活<br />咿咿 应该多干活<br />小和尚说年龄幼身体太单薄<br />嘿 身体太单薄呀<br />咿 身体太单薄呀<br />白胡子的长老说我年老不口渴<br />嘿嘿 白胡子的长老说我年老不口渴<br />一个和尚挑呀么挑水喝<br />两个和尚抬呀么抬水喝<br />三个和尚没呀么没水喝<br />你说这是为什么呀为什么<br />从此以后呀和尚都不抬水喝<br />不挑水的日子还是一样过<br />谁也不用奇怪也别问为什么呀<br />几千年的奥妙谁也不会说破<br />几千年的奥妙谁也不会说破<br />谁也不会说破','http://www.61baobao.com/common/flash/2006/dpic/354.jpg','354','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5PYUdKdFpHeE1iazR6V21jOVBRPT0=','http://s.61baobao.com/common/flash/2006/sange.swf','http://www.61baobao.com/common/flash/2006/dpic/354.jpg','http://www.61baobao.com/common/flash/2006/pic/354.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('2249','17','http://www.61baobao.com/tingerge/353/','0','2012-06-29 02:22:30','吹草哨','2012-06-29 02:22:30','4usky','2','1340907750','','http://www.61baobao.com/common/flash/2006/pic/353.jpg','','0','','http://s.61baobao.com/common/flash/2006/chui.swf','667','479','哔哩哩 哔哩哩，哨音像银铃。<br />多好听云雀惊，展翅飞入云。<br />低头看拖拉机，忙耕耘忙耕耘。<br />春光一刻值千金，莫耽误节令。<br />哔哩哩 哔哩哩 哔哩哩，<br />万紫千红春天又来临。<br />摘草叶口中吹，哨音像银铃。<br /><br />哔哩哩 哔哩哩，哨音像银铃。<br />多好听鲤鱼惊，结队水面行。<br />水库宽 清粼粼，好风景 好风景。<br />天高水阔凭鱼跃，满眼是银鳞。<br />哔哩哩 哔哩哩 哔哩哩，<br />万紫千红春天又来临。<br />摘草叶口中吹，哨音像银铃。<br /><br />哔哩哩 哔哩哩，哨音像银铃。<br />多好听蓓蕾惊，窗旁传花信。<br />金达莱最先开。笑冰凌笑冰凌，<br />春天一到雪融尽，原野花似锦。<br />哔哩哩 哔哩哩哔哩哩，<br />万紫千红春天又来临。<br />','http://www.61baobao.com/common/flash/2006/dpic/353.jpg','353','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpPYjJSWGEzVmpNMlJ0','http://s.61baobao.com/common/flash/2006/chui.swf','http://www.61baobao.com/common/flash/2006/dpic/353.jpg','http://www.61baobao.com/common/flash/2006/pic/353.jpg','三个月以上','0','0','','0');");
