E_D("replace into `phome_ecms_infotmp_game` values('2254','17','http://www.61baobao.com/tingerge/347/','0','2012-06-29 02:22:36','采蘑菇的小姑娘','2012-06-29 02:22:36','4usky','2','1340907756','','http://www.61baobao.com/zt/qinbao/pic/caimogu.jpg','','0','','http://s.61baobao.com/zt/qinbao/caimogu.swf','667','479','采蘑菇的小姑娘<br /><br />背着一个大竹筐<br /><br />清晨光着小脚丫<br /><br />走遍森林和山冈<br /><br />她采的蘑菇最多<br /><br />多得像那星星数不清<br /><br />她采的蘑菇最大<br /><br />大得像那小伞装满筐<br /><br />噻箩箩哩噻箩箩哩噻<br /><br />噻箩箩箩<br /><br />噻箩箩箩哩噻<br /><br />谁不知这山里的蘑菇香<br /><br />她却不肯尝一尝<br /><br />攒到赶集的那一天<br /><br />赶快背到集市上<br /><br />换上一把小镰刀<br /><br />再加上几块棒棒糖<br /><br />和那小伙伴一起<br /><br />把劳动的幸福来分享<br /><br />噻箩箩哩噻箩箩哩噻<br /><br />噻箩箩箩<br /><br />噻箩箩箩哩噻<br /><br />噻箩箩哩噻箩箩哩噻<br /><br />噻箩箩箩<br /><br />噻箩箩箩哩噻<br /><br />噻箩箩哩噻箩箩哩噻<br /><br />噻箩箩箩<br /><br />噻箩箩箩哩噻<br /><br />噻箩箩哩噻箩箩哩噻<br /><br />噻箩箩箩<br /><br />噻箩箩箩哩噻','http://www.61baobao.com/zt/qinbao/dpic/caimogu.jpg','347','VEROd01Fd3pSbkJpYlVwb1luazVhbGxYYkhSaU1tUXhURzVPTTFwblBUMD0=','http://s.61baobao.com/zt/qinbao/caimogu.swf','http://www.61baobao.com/zt/qinbao/dpic/caimogu.jpg','http://www.61baobao.com/zt/qinbao/pic/caimogu.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('2255','17','http://www.61baobao.com/tingerge/346/','0','2012-06-29 02:22:36','每当我走过老师窗前','2012-06-29 02:22:36','4usky','2','1340907756','','http://www.61baobao.com/common/flash/2006/pic/346.jpg','','0','','http://s.61baobao.com/common/flash/2006/meidang.swf','667','479','静静的深夜群星在闪耀<br />老师的房间彻夜明亮<br />每当我轻轻走过您窗前<br />明亮的灯光照耀我心房<br />啊，每当想起您，敬爱的老师<br />一阵阵暖流心中激荡<br />培育新一代辛勤的园丁<br />今天深夜啊仍在亮<br />呕心沥血您在写教材<br />高大的身影映在您窗上<br />啊，每当想起您，敬爱的老师<br />一阵阵暖流心中激荡<br />[采蘑菇的小姑娘]<br />晓光词谷建芬曲演唱：田蕙<br />采蘑菇的小姑娘，背着一个大箩筐<br />清早光着小脚丫，走遍树林河山冈<br />她采的蘑菇最多，多得像那星星数不清<br />她采的蘑菇最大，大得像那小伞装满筐<br />赛罗罗罗罗里赛罗哩赛，<br />赛罗罗罗罗罗哩赛罗哩赛<br />赛罗罗哩赛罗罗哩赛罗罗哩赛罗罗哩赛<br />罗罗罗哩赛。<br />谁不知那山里的蘑菇香<br />她却不肯尝一尝<br />盼到赶集的那一天，快快背到集市上<br />换上一把小镰刀，再换上几块棒棒糖<br />和那小伙伴一起，把劳动的幸福来分享<br />','http://www.61baobao.com/common/flash/2006/dpic/346.jpg','346','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREl4YkdGWFVtaGliV04xWXpOa2JRPT0=','http://s.61baobao.com/common/flash/2006/meidang.swf','http://www.61baobao.com/common/flash/2006/dpic/346.jpg','http://www.61baobao.com/common/flash/2006/pic/346.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('2256','17','http://www.61baobao.com/tingerge/345/','0','2012-06-29 02:22:36','让我们荡起双浆','2012-06-29 02:22:36','4usky','2','1340907756','','http://www.61baobao.com/common/flash/2006/pic/345.jpg','','0','','http://s.61baobao.com/common/flash/2006/ranwomendangqi.swf','667','479','  让我们荡起双桨，<br />小船儿推开波浪。<br />海面倒映着美丽的白塔，<br />四周环绕着绿树红墙。<br />小船儿轻轻飘荡在水中，<br />迎面吹来了凉爽的风。<br />红领巾迎着太阳，<br />阳光洒在海面上。<br />水中鱼儿望着我们，<br />悄悄地听我们愉快歌唱。<br />小船儿轻轻飘荡在水中，<br />迎面吹来了凉爽的风。<br />做完了一天的功课，<br />我们来尽情欢乐。<br />我问你亲爱的伙伴，<br />谁给我们安排下幸福的生活。<br />小船儿轻轻飘荡在水中，<br />迎面吹来了凉爽的风','http://www.61baobao.com/common/flash/2006/dpic/345.jpg','345','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5LYUdKdVpIWmlWMVoxV2tkR2RWb3pSbkJNYms0eldtYzlQUT09','http://s.61baobao.com/common/flash/2006/ranwomendangqi.swf','http://www.61baobao.com/common/flash/2006/dpic/345.jpg','http://www.61baobao.com/common/flash/2006/pic/345.jpg','三个月以上','0','0','','0');");
