E_D("replace into `phome_ecms_infotmp_game` values('2261','17','http://www.61baobao.com/tingerge/341/','0','2012-06-29 02:22:48','大长今（儿童版）','2012-06-29 02:22:48','4usky','2','1340907768','','http://www.61baobao.com/common/flash/2006/pic/341.jpg','','0','','http://s.61baobao.com/common/flash/2006/dachangjin.swf','667','479','雾来啦雾来啦娃娃哭啦,想爸爸想妈妈想要回家,<br />雾来啦雾来啦天色暗啦,星发光心发慌没有方向,<br />嘿呀嘿呀谁能给我力量,路漫长爱漫长带我回家,<br />不要怕不要怕我的娃娃,一朵花一粒砂就是天涯,<br />不要怕不要怕赶快长大,等太阳的光芒带来希望,<br />雾散啦雾散啦娃娃笑啦,听爸爸听妈妈唱歌说话,<br />雾散啦雾散啦天色亮啦,看阳光的方向就有希望,<br />嘿呀嘿呀爱能给我力量,路漫长爱漫长我们回家.','http://www.61baobao.com/common/flash/2006/dpic/341.jpg','341','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpTYUZreWFHaGliV1J4WVZjMGRXTXpaRzA9','http://s.61baobao.com/common/flash/2006/dachangjin.swf','http://www.61baobao.com/common/flash/2006/dpic/341.jpg','http://www.61baobao.com/common/flash/2006/pic/341.jpg','三个月以上','0','0','','0');");
