E_D("replace into `phome_ecms_infotmp_game` values('2265','17','http://www.61baobao.com/tingerge/336/','0','2012-06-29 02:22:54','吉祥三宝','2012-06-29 02:22:54','4usky','2','1340907774','','http://www.61baobao.com/common/flash/2006/pic/336.jpg','','0','','http://s.61baobao.com/common/flash/2006/jixiangsabao.swf','667','479','词曲/布仁巴雅尔<br /><br />    小女孩问：“爸爸，太阳出来月亮回家了吗？”爸爸回答：“没有。”小女孩问：“星星出来太阳去哪里了？”爸爸回答：“在天上。”小女孩问：“我怎么找也找不到它？”爸爸回答：“回家了。”女儿爸爸合：“太阳月亮星星就是吉祥的一家。”小女孩问：“妈妈，叶子绿了什么时候开花？”妈妈回答：“等叶子落了。”小女孩问：“花儿红了果实能去摘吗？”妈妈回答：“等花儿谢了。”小女孩问：“果实种在土里会发芽吗？”妈妈回答：“等到春天。”爸爸妈妈女儿合：“花儿叶子果实就是吉祥的一家。”爸爸妈妈问女儿：“宝贝，爸爸像太阳照着妈妈。”女儿回答：“那妈妈呢？”爸爸妈妈回答：“妈妈像绿叶托着红花。”女儿回答：“那我呢？”爸爸妈妈回答：“你像种子一样正在发芽。”女儿回答：“明白了。”爸爸妈妈女儿合：“我们三个就是吉祥如意的一家。”　　','http://www.61baobao.com/common/flash/2006/dpic/336.jpg','336','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREp3Y0dWSGJHaGliV1I2V1ZkS2FHSjVOWHBrTWxrOQ==','http://s.61baobao.com/common/flash/2006/jixiangsabao.swf','http://www.61baobao.com/common/flash/2006/dpic/336.jpg','http://www.61baobao.com/common/flash/2006/pic/336.jpg','三个月以上','0','0','','0');");
