E_D("replace into `phome_ecms_infotmp_game` values('2271','17','http://www.61baobao.com/tingerge/330/','0','2012-06-29 02:23:00','早操歌','2012-06-29 02:23:00','4usky','2','1340907780','','http://www.61baobao.com/common/flash/2006/pic/330.jpg','','0','','http://s.61baobao.com/common/flash/2006/zaocaoge.swf','667','479','天上的朝霞好像百花开放<br />树上的小鸟快乐地歌唱<br />早晨的空气多么新鲜<br />早晨的风呀多么清爽<br />我们天天起得早<br />起来就做早操<br /><br />冬天我们不怕大雪和风霜<br />夏天里不怕火热的太阳<br />我们游泳 我们滑冰<br />看我的身体多么健壮<br />我们天天起得早<br />起来就做早操<br />我们的精神总是这样愉快<br />我们的脑筋灵活又聪明<br />每天的功课样样做好<br />新的知识不断增长<br />我们天天起得早<br />起来就做早操','http://www.61baobao.com/common/flash/2006/dpic/330.jpg','330','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE53YUdJeVRtaGlNbVJzVEc1T00xcG5QVDA9','http://s.61baobao.com/common/flash/2006/zaocaoge.swf','http://www.61baobao.com/common/flash/2006/dpic/330.jpg','http://www.61baobao.com/common/flash/2006/pic/330.jpg','三个月以上','0','0','','0');");
