E_D("replace into `phome_ecms_infotmp_game` values('2296','17','http://www.61baobao.com/tingerge/304/','0','2012-06-29 02:23:37','在爱里成长','2012-06-29 02:23:37','4usky','2','1340907817','','http://www.61baobao.com/common/flash/2006/pic/304.jpg','','0','','http://s.61baobao.com/common/flash/2006/zaiailichengzhang.swf','667','479','蓝蓝的天，白白的云，<br />绿的叶儿，红的太阳<br />我的天空，我的白云，<br />我的森林，我的太阳,啊啊<br />我伸出双手，放眼四方<br />我伸出双手，放声歌唱<br />我看见，太阳在笑，花在开放<br />我看见，树伸着腰，向上生长<br />我看见天空打开心窗，任鸟飞翔<br />我看见朵朵云儿结伴，飘向远方<br />蓝蓝的天，白白的云，<br />绿的叶儿，红的太阳<br />我的天空，我的白云，<br />我的森林，我的太阳,啊啊<br />太阳太阳，照着大地，发热发光<br />天空天空，高挂在上，宽阔无边<br />爸爸放的风筝，飘在白云上，向我点头笑<br />妈妈坐在树荫下，唱着歌谣，进入我梦乡<br />蓝蓝的天，白白的云，<br />绿的叶儿，红的太阳<br />我的梦想，我的歌声，<br />我的快乐，我的家乡，啊啊<br />我伸出双手，伸向四方<br />我伸出双手，在爱里成长，啊啊','http://www.61baobao.com/common/flash/2006/dpic/304.jpg','304','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE53YUdGWFJuQmlSMnhxWVVkV2RWb3pjRzlaVnpWdVRHNU9NMXBuUFQwPQ==','http://s.61baobao.com/common/flash/2006/zaiailichengzhang.swf','http://www.61baobao.com/common/flash/2006/dpic/304.jpg','http://www.61baobao.com/common/flash/2006/pic/304.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('2297','17','http://www.61baobao.com/tingerge/305/','0','2012-06-29 02:23:43','鲁冰花','2012-06-29 02:23:43','4usky','2','1340907823','','http://www.61baobao.com/common/flash/2006/pic/305.jpg','','0','','http://s.61baobao.com/common/flash/2006/lubinghua0215.swf','667','479','夜夜想起妈妈的话<br />闪闪的泪光鲁冰花<br />天上的星星不说话<br />地上的娃娃想妈妈<br />天上的眼睛眨呀眨<br />妈妈的心呀鲁冰花<br />家乡的茶园开满花<br />妈妈的心肝在天涯<br />夜夜想起妈妈的话<br />闪闪的泪光鲁冰花<br />啊<br />夜夜想起妈妈的话<br />闪闪的泪光鲁冰花<br />啊<br />夜夜想起妈妈的话<br />闪闪的泪光<br />(唱)闪闪的泪光<br />我知道半夜的星星会唱歌<br />想家的夜晚它就这样和我一唱一和<br />我知道午后的清风会唱歌<br />童年的蝉声它总是跟风一唱一和<br /><br />当手中握妆华<br />心情却变得荒芜<br />才发现世上一切都会变卦<br />当青春剩下日记<br />乌丝就要变成白发<br />不变的只有那首歌<br />在心中来回地唱','http://www.61baobao.com/common/flash/2006/dpic/305.jpg','305','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREo0TVZsdGJIVmFNbWd4V1ZSQmVVMVVWWFZqTTJSdA==','http://s.61baobao.com/common/flash/2006/lubinghua0215.swf','http://www.61baobao.com/common/flash/2006/dpic/305.jpg','http://www.61baobao.com/common/flash/2006/pic/305.jpg','三个月以上','0','0','','0');");
