E_D("replace into `phome_ecms_infotmp_game` values('2309','17','http://www.61baobao.com/tingerge/293/','0','2012-06-29 02:24:02','大树桩你有几岁','2012-06-29 02:24:02','4usky','2','1340907842','','http://www.61baobao.com/common/flash/2006/pic/293.jpg','','0','','http://s.61baobao.com/common/flash/2006/dashuzhuang.swf','667','479','小河边有一颗大树桩，<br />树桩上一圈圈真漂亮。<br />哎哟哟哟，大树桩罗，你有几岁。<br />哎哟哟哟，谁知道罗，谁来讲罗。<br />数一数树桩上圆圈有多少，<br />几十圈，几十圈，不多也不少。<br />啊哈哈哈，大树桩罗，你有几十岁。<br />啊哈哈哈，你比爷爷年纪还要大罗。 <br />啊哈哈哈，你比爷爷年纪还要大罗。','http://www.61baobao.com/common/flash/2006/dpic/293.jpg','293','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpTYUdNeWFERmxiV2d4V1ZjMWJreHVUak5hWnowOQ==','http://s.61baobao.com/common/flash/2006/dashuzhuang.swf','http://www.61baobao.com/common/flash/2006/dpic/293.jpg','http://www.61baobao.com/common/flash/2006/pic/293.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('2310','17','http://www.61baobao.com/tingerge/291/','0','2012-06-29 02:24:02','歌唱二小放牛郎','2012-06-29 02:24:02','4usky','2','1340907842','','http://www.61baobao.com/common/flash/2006/pic/291.jpg','','0','','http://s.61baobao.com/common/flash/2006/erxiao.swf','667','479','牛儿还在山坡吃草， <br />放牛的却不知道哪儿去了？ <br />不是他贪玩耍丢了牛， <br />那放牛的孩子王二小。 <br />九月十六那天早上， <br />敌人向一条山沟扫荡， <br />山沟里掩护着后方机关， <br />掩护着几千老乡。 <br />正在那十分危急的时候， <br />敌人快要走到山口， <br />昏头昏脑地迷失了方向， <br />抓住了二小要他带路。 <br />二小他顺从地走在前面， <br />把敌人带进我们的埋伏圈， <br />四下里乒乓乒乓响起了枪炮， <br />敌人才知道受了骗。 <br />敌人把二小挑在枪尖， <br />摔死在大石头的上面， <br />我们那十三岁的二小， <br />可怜他死得这样惨。 <br />干部和老乡得到了安全， <br />他却睡在冰冷的山间， <br />他的脸上含着微笑， <br />他的血染红蓝的天。 <br />秋风吹遍了每个村庄， <br />它把这个动人的故事传扬， <br />每一个村庄都含着眼泪， <br />歌唱着二小放牛郎。<br />','http://www.61baobao.com/common/flash/2006/dpic/291.jpg','291','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpXZVdWSGJHaGllVFY2WkRKWlBRPT0=','http://s.61baobao.com/common/flash/2006/erxiao.swf','http://www.61baobao.com/common/flash/2006/dpic/291.jpg','http://www.61baobao.com/common/flash/2006/pic/291.jpg','三个月以上','0','0','','0');");
