E_D("replace into `phome_ecms_infotmp_game` values('2367','17','http://www.61baobao.com/tingerge/234/','0','2012-06-29 02:25:27','外婆的澎湖湾','2012-06-29 02:25:27','4usky','2','1340907927','','http://www.61baobao.com/common/flash/2006/pic/234.jpg','','0','','http://s.61baobao.com/common/flash/2006/waipo.swf','667','479','晚风轻拂着澎湖湾<br />白浪逐沙滩<br />没有椰林醉斜阳<br />只是一片海蓝蓝<br />坐在门前的矮墙上一遍遍回想<br />也是黄昏的沙滩上有着脚印两对半<br />那是外婆拄着杖将我手轻轻挽<br />踩着薄暮走向余晖暖暖的澎湖湾<br />一个脚印是笑语一串消磨许多时光<br />直到夜色吞没我俩在回家的路上<br />澎湖湾澎湖湾外婆的澎湖湾<br />有我许多的童年幻想<br />阳光沙滩海浪仙人掌<br />还有一位老船长<br /><br />','http://www.61baobao.com/common/flash/2006/dpic/234.jpg','234','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5rYUdGWVFuWk1iazR6V21jOVBRPT0=','http://s.61baobao.com/common/flash/2006/waipo.swf','http://www.61baobao.com/common/flash/2006/dpic/234.jpg','http://www.61baobao.com/common/flash/2006/pic/234.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('2368','17','http://www.61baobao.com/tingerge/233/','0','2012-06-29 02:25:27','一只只小鸟','2012-06-29 02:25:27','4usky','2','1340907927','','http://www.61baobao.com/common/flash/2006/pic/233.jpg','','0','','http://s.61baobao.com/common/flash/2006/xiaoxiaoniao.swf','667','479','有时候我觉得自己<br />永远都吃不饱<br />也许只有吃得很多才能够长高<br />盼望能有一张迷人的相貌<br />把所有人都迷倒<br />最后发现只有一种方法<br />是用蒙汗药<br />长大之后无奈进入了社会<br />我总是睡不著<br />我怀疑公司给别人的工资<br />都比我高<br />总是努力学着对别人微笑<br />难免也中他们圈套<br />偶尔上帝也会对我说<br />失败很重要<br />我是一只只只只只小鸟<br />因为吃得太多已经飞飞不高<br />我寻觅一颗栖息的树<br />已被我压折了<br />这样的重量算不算太高<br />我是一只只只只只小鸟<br />突然一天醒来有了迷人的美貌<br />麻雀也能飞上青天<br />谁的歌声真美妙<br />美女的要求也不算太高<br /><br />','http://www.61baobao.com/common/flash/2006/dpic/233.jpg','233','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5vY0ZsWE9UUmhWMFoyWW0xc2FHSjVOWHBrTWxrOQ==','http://s.61baobao.com/common/flash/2006/xiaoxiaoniao.swf','http://www.61baobao.com/common/flash/2006/dpic/233.jpg','http://www.61baobao.com/common/flash/2006/pic/233.jpg','三个月以上','0','0','','0');");
